import React, { useEffect } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Route, Routes, useLocation } from "react-router-dom";
import SignUp from './components/SignUp';
import SignIn from './components/SignIn';
import GetProducts from './components/GetProducts';
import MpesaPayment from './components/MpesaPayment';
import AboutUs from './components/AboutUs';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Brands from './components/Brands';
import Login from './components/LogIn';
import Cart from './components/Cart';
import Guides from './components/Guide';
import { CartProvider } from './components/CartContext'; // Import CartProvider
import AddProducts from './components/AddPropducts';
import Faqs from './components/Faqs'; // Import Faqs component
import ContactUs from './components/ContactUs';

const App = () => {
  return (
    <CartProvider> {/* Wrap your app with CartProvider */}
      <div className="App">
        <header className="App-header">
          <h1>Hofistis-e-commerce online</h1>
          <div className="scroll-text">
            <i>Elite performance sticks for major hockey brands for every playing style - Browse our collection</i>
          </div>
        </header>

        <Router>
          <Navbar />
          <PageLayout>
            <Routes>
              <Route path="/signup" element={<SignUp />} />
              <Route path="/signin" element={<SignIn />} />
              <Route path="/addproducts" element={<AddProducts />} />
              <Route path="/" element={<GetProducts />} />
              <Route path="/mpesapayment" element={<MpesaPayment />} />
              <Route path="/aboutus" element={<AboutUs />} />
              <Route path="/brands" element={<Brands />} />
              <Route path="/cart" element={<Cart />} />
              <Route path="/guide" element={<Guides />} />
              <Route path="/login" element={<Login />} />
              <Route path="/contactus" element={<ContactUs />} />
              <Route path="/faqs" element={<Faqs />} />
            </Routes>
          </PageLayout>

          <Footer />
        </Router>
      </div>
    </CartProvider>
  );
};

// Layout component to handle dynamic background color based on route
const PageLayout = ({ children }) => {
  const location = useLocation();

  // Change background color based on the current route
  useEffect(() => {
    const body = document.body;

    // Reset default background color first
    body.style.backgroundColor = '';

    switch (location.pathname) {
      case '/':
        body.style.backgroundColor = '#f1f1f1';  // Light Grey for Home
        break;
      case '/aboutus':
        body.style.backgroundColor = '#2ecc71';  // Green for About
        break;
      case '/brands':
        body.style.backgroundColor = '#3498db';  // Blue for Brands
        break;
      case '/cart':
        body.style.backgroundColor = '#f39c12';  // Orange for Cart
        break;
      case '/contactus':
        body.style.backgroundColor = '#8e44ad';  // Purple for Contact Us
        break;
      case '/faqs':
        body.style.backgroundColor = '#e74c3c';  // Red for FAQs
        break;
      default:
        body.style.backgroundColor = '#ffffff';  // Default white background
        break;
    }
  }, [location]);

  return (
    <div>
      {children}
    </div>
  );
};

export default App;
